import "./style/General.css"
// import "./style/NerfPage.css"

import NavBar from "./NavBar";

const NerfPage = () => {
    return (
        <div className="page">
            <NavBar />

            <div className="content">
                {/* Summary Section */}
                <div id="nerf-header">
                    <h1> NERF 101 </h1>
                    <h2> June-August 2022 </h2>
                    <h2> Python </h2>
                </div>
            </div>
        </div>
    )
}

export default NerfPage;
